window.bookSummaryJSON = "<p>I thought the last thing I would have expected while working at the mall during the holiday season was to meet a real elf woman. Then the blue-skinned ogre tore through the mall. The elf and I made a quick escape and ended up in a strange fantasy world.</p> <p>Now, I’m finding out that the elves have been in decline for centuries and are being hunted to extinction for their magical abilities.</p> <p>They need someone to help them. Someone to protect them. Someone with magical powers that could make elves strong like they used to be.</p> <p>Apparently, I’m that someone. And there are a whole lot of elf species who could use my protection.</p>"; 
